data.text:
— Lo seguiré haciendo mientras sigas siendo un suicida en potencia. 

Aquello ya no lo dijo de una forma tan sana y amistosa. Aquello le preocupaba de verdad porque Wrynn era el inventor del balconing en Dystopia. Y eso no iba a olvidarlo fácilmente. 

No supo de dónde sacó &gt;

@Peli_Comic Y el cast de Escuadrón Suicida contará con miembros de Marvel.
-Nathan Fillion y Sean Gunn: Guardianes de la galaxia 1 y 2.
-Taika Waititi: Thor Ragnarok y La futura Love And Thunder.

